const persona =  {
    nombre: 'Sebastian',
    apellido: 'Colombo',
    edad:38,
    direccion:{
        ciudad: 'Montevideo',
        zip: 12900,
    }
};

console.log(persona);

const persona2 = persona;

console.log(persona2);

persona2.nombre = 'Juan';

console.log(persona);
console.log(persona2);
